import React, { useState } from 'react';

export default function Form1(props) {
    const [formData, setFormData] = useState({
      name: '',
      ab: null,
      bc: null,
      cd: null,
      da: null,
      bd: null,
      n: null,
    });
  
    const handleChange = (e) => {
      const { name, value } = e.target;
      setFormData({ ...formData, [name]: value });
    };
  
    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
      };

    const [result, setResult] = useState(null);
  
    const handleSubmit = (e) => {
      e.preventDefault();
      // Changing the background image
      props.func("/landareadivider_result1.png")
      // Calculate the area here using the provided formula
      console.log(formData)
      const { ab, bc, cd, da, bd } = formData;
      const area = ab + bc + cd + da + bd  
      /* Perform your area calculation here */
      setResult(area);
    };
  
    return (
      <>
      <form method="post" onSubmit={handleSubmit} noValidate>
          <h4>This Form is for Land Division in Equal Part</h4>
          <p><i>Each length must be in the same unit</i></p>

          <input type="hidden" name="csrfmiddlewaretoken" value={ window.CSRF_TOKEN } />
  
          <p>
            <label htmlFor="name">Name: </label>
            <input
              type="text"
              name="name"
              maxLength="100"
              id="name"
              placeholder='Enter Any Name'
              value={formData.name}
              onChange={handleChange}
            />
          </p>
  
          <p>
          <label htmlFor="id_ab">AB: </label>
          <input
            type="number"
            name="ab"
            step="any"
            required
            id="id_ab"
            placeholder='Enter length of AB'
            value={formData.ab}
            onChange={handleInputChange}
          />
          </p>
  
          <p>
              <label htmlFor="id_bc">BC: </label>
              <input
              type="number"
              name="bc"
              step="any"
              required
              id="id_bc"
              placeholder='Enter length of BC'
              value={formData.bc}
              onChange={handleInputChange}
              />
          </p>
  
          <p>
              <label htmlFor="id_cd">CD: </label>
              <input
              type="number"
              name="cd"
              step="any"
              required
              id="id_cd"
              placeholder='Enter length of CD'
              value={formData.cd}
              onChange={handleInputChange}
              />
          </p>
  
          <p>
              <label htmlFor="id_da">DA: </label>
              <input
              type="number"
              name="da"
              step="any"
              required
              id="id_da"
              placeholder='Enter length of DA'
              value={formData.da}
              onChange={handleInputChange}
              />
          </p>
  
          <p>
              <label htmlFor="id_bd">BD: </label>
              <input
              type="number"
              name="bd"
              step="any"
              required
              id="id_bd"
              placeholder='Enter length of BD'
              value={formData.bd}
              onChange={handleInputChange}
              />
          </p>

          <p>
            <label htmlFor="id_n">n: </label>
            <input
            type="number"
            name="n"
            step="any"
            required
            id="id_bd"
            placeholder='Enter Number of People'
            title='Number of People'
            value={formData.n}
            onChange={handleInputChange}
            />
        </p>
  
          <button type="submit" name="form_type" value="form1" className="btnstyle">
            Get Result
          </button>
        </form>
        <p className="pstyle"><i><b>Note: </b></i>we have to make equal section on front side of field</p>
        <p className="pstyle">AP<sub>1</sub>=P<sub>1</sub>P<sub>2</sub>=P<sub>2</sub>P<sub>3</sub>=...=P<sub>n-1</sub>B</p>
        {result !== null && (
          <div>
            <h2>Result</h2>
            <p>The calculated area is: {result} square units</p>
          </div>
        )}
      </>
    );
  }
